import "./App.css";

function App() {
  return (
    <div className="global-container">
      <header className="header">
        <div className="header-top">
          <img
            src="http://localhost:1337/uploads/roquette_logo_edeb6876e0.webp"
            className="App-logo"
            alt="logo"
          />
        </div>
        <div className="header-bottom"></div>
      </header>
    </div>
  );
}

export default App;
